    await ActionUtils.waitForSpecificTime(5000);
    await browser.pause(15000);
})

When(/^Actor fills in the user credentials "([^\"]*)" and submit$/, async (username) => {
    dashboard_page = await LoginPage.login(username, loginData[username]);
